import React, { useState, useContext, createContext, useEffect, useMemo } from 'react';
import { MapContainer, TileLayer, GeoJSON } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import regionsGeoJSON from './france-regions.json';

const RegionContext = createContext();

const RegionProvider = ({ children }) => {
  const [regions, setRegions] = useState([]);

  const addRegion = (region) => {
    setRegions((prev) => {
      const existing = prev.find((r) => r.name.toLowerCase() === region.name.toLowerCase());
      if (existing) {
        return prev.map((r) =>
          r.name.toLowerCase() === region.name.toLowerCase() 
            ? { ...r, intensity: r.intensity + region.intensity } 
            : r
        );
      }
      return [...prev, region];
    });
  };

  return (
    <RegionContext.Provider value={{ regions, addRegion }}>
      {children}
    </RegionContext.Provider>
  );
};

const Dashboard = () => {
  return (
    <RegionProvider>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <h1>Carte des Régions Françaises</h1>
        <RegionForm />
        <RegionMap />
      </div>
    </RegionProvider>
  );
};

const RegionForm = () => {
  const { addRegion } = useContext(RegionContext);
  const [formData, setFormData] = useState({ name: '', intensity: 1 });

  const handleSubmit = (e) => {
    e.preventDefault();
    const trimmedName = formData.name.trim();
    const intensity = parseInt(formData.intensity, 10);

    if (!trimmedName || isNaN(intensity) || intensity < 1) {
      alert("Veuillez fournir un nom valide et une intensité positive.");
      return;
    }

    addRegion({ 
      name: trimmedName, 
      intensity: intensity 
    });

    setFormData({ name: '', intensity: 1 });
  };

  return (
    <form onSubmit={handleSubmit} style={{ marginBottom: '20px' }}>
      <select
        value={formData.name}
        onChange={(e) => setFormData({ ...formData, name: e.target.value })}
        required
      >
        <option value="">Sélectionnez une région</option>
        {regionsGeoJSON.features.map((region) => (
          <option key={region.properties.nom} value={region.properties.nom}>
            {region.properties.nom}
          </option>
        ))}
      </select>
      <input
        type="number"
        placeholder="Intensité"
        value={formData.intensity}
        onChange={(e) => setFormData({ ...formData, intensity: e.target.value })}
        min="1"
        required
      />
      <button type="submit">Ajouter Région</button>
    </form>
  );
};

const RegionMap = () => {
  const { regions } = useContext(RegionContext);

  const getColor = (regionName) => {
    const regionData = regions.find(r => r.name.toLowerCase() === regionName.toLowerCase());
    const intensity = regionData ? regionData.intensity : 0;

    return intensity > 5 
      ? '#800026' 
      : intensity > 3 
        ? '#BD0026' 
        : intensity > 1 
          ? '#FED976' 
          : '#FFEDA0';
  };

  const onEachFeature = (feature, layer) => {
    const regionName = feature.properties.nom;
    const regionData = regions.find(r => r.name.toLowerCase() === regionName.toLowerCase());
    const intensity = regionData ? regionData.intensity : 0;

    layer.setStyle({ 
      fillColor: getColor(regionName), 
      fillOpacity: 0.7, 
      color: '#000', 
      weight: 1 
    });

    layer.bindPopup(`
      <strong>${regionName}</strong><br>
      Intensité: ${intensity}
    `);
  };

  // Utilisation de useMemo pour éviter les re-rendus inutiles
  const memoizedGeoJSON = useMemo(() => {
    return (
      <GeoJSON 
        data={regionsGeoJSON} 
        onEachFeature={onEachFeature} 
      />
    );
  }, [regions]);

  return (
    <MapContainer
      key="france-map"  // Clé unique pour forcer un nouveau rendu si nécessaire
      style={{ height: '500px', width: '800px' }}
      center={[46.5, 2.5]}
      zoom={5}
      maxZoom={10}
      minZoom={4}
    >
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
      {memoizedGeoJSON}
    </MapContainer>
  );
};

export default Dashboard;
